exports.download_get = (req, res)=>{
    var email = req.session.email;
    if(email){
        var row = "hidden";
        var date = [];
        var reg = new Date();
        var today = new Date();
        var m = ["January", "February", "March", "April", "May", "June", "July", "August", "September", "October", "November", "December"];
        var text = [];
        db.query('SELECT data_registrazione FROM account WHERE email = ?', [email], function(error, results, fields){
            reg = results[0].data_registrazione;
            
            var year1=reg.getFullYear();
            var year2=today.getFullYear();
            var month1=reg.getMonth()+1;
            var month2=today.getMonth()+1;
            if(month1===0){ //Have to take into account
                  month1++;
                month2++;
            }
            var numberOfMonths=(year2 - year1) * 12 + (month2 - month1);
            
            if(numberOfMonths > 0){
                for(var i=0; i<numberOfMonths; i++){
                    date[i] = year1 + '-' + month1 + '-' + '01';
                    var temp = (parseInt(date[i].substr(5,6), 10)) -1;
                    text[i] = m[temp] + " " + date[i].substr(0,4); 
                    month1 = month1 + 1;
                    if(month1 == 13){
                        month1 = 01;
                        year1 = year1 + 1;
                    }
                    
                    
                }
            } else {
                date[0] = year1 + '-' + month1 + '-' + '01';
                var temp = (parseInt(date[0].substr(5,6), 10)) -1;
                    text[0] = m[temp] + " " + date[0].substr(0,4);
            }
            res.render('download.ejs', {text: text, date: date, testo: "visible", descrizionenull: "Please select one month", row: row, range:"", file:""});
        })

    }else{
        res.redirect('/home');
    }

}

